import React, { Component } from "react";
import hamburgerImage from "../images/square.png";

class Sidemenu extends Component {
  render() {
    const sideMenu = {
      width: "30px",
      position: "fixed",
      top: "20px",
      right: "20px",
      zIndex: "2000",
      cursor: "pointer",
    };
    const styleMenu = {
      position: "fixed",
      width: "300px",
    };
    return (
      <>
        <img src={hamburgerImage} alt="menu" style={sideMenu} />
        <div>
          <ul>
            <li>Link 1</li>
            <li>Link 2</li>
            <li>Link 3</li>
            <li>Link 4</li>
            <li>Link 5</li>
            <li>Link 6</li>
          </ul>
        </div>
      </>
    );
  }
}

export default Sidemenu;
